/// Request to update participant permissions
#[derive(Debug, Clone, Serialize, Deserialize)]
pub struct UpdateParticipantPermissionsRequest {
    #[serde(rename = "conferenceId")]
    pub conference_id: String,
    #[serde(rename = "agentId")]
    pub agent_id: String,
    pub permissions: Vec<Permission>,
}

/// Manager for conference operations
pub struct ConferenceManager {
    pub(crate) db: Arc<RwLock<Option<DatabaseManager>>>,
}

impl ConferenceManager {
    pub fn new(db: Arc<RwLock<Option<DatabaseManager>>>) -> Self {
        Self { db }
    }

    /// Initialize conference database schema
    pub async fn initialize_schema(&self) -> Result<(), String> {
        let db = self.db.read().await;
        let pool = &db.as_ref().unwrap().write_pool;

        // Conferences table
        sqlx::query(
            r#"
            CREATE TABLE IF NOT EXISTS core_conferences (
                conference_id TEXT PRIMARY KEY,
                session_id TEXT NOT NULL,
                title TEXT NOT NULL,
                purpose TEXT NOT NULL,
                conference_type TEXT NOT NULL,
                participants TEXT NOT NULL,
                shared_memory_id TEXT,
                tool_closet_id TEXT,
                workflow_id TEXT,
                state TEXT NOT NULL,
                created_at TEXT NOT NULL,
                started_at TEXT,
                concluded_at TEXT,
                created_by TEXT NOT NULL,
                FOREIGN KEY (session_id) REFERENCES core_sessions (session_id)
            )
            "#,
        )
        .execute(pool)
        .await
        .map_err(|e| format!("Failed to create conferences table: {}", e))?;

        // Conference participants table (for easier querying)
        sqlx::query(
            r#"
            CREATE TABLE IF NOT EXISTS core_conference_participants (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                conference_id TEXT NOT NULL,
                agent_id TEXT NOT NULL,
                role TEXT NOT NULL,
                joined_at TEXT NOT NULL,
                permissions TEXT NOT NULL,
                individual_memory_id TEXT,
                assigned_tools TEXT NOT NULL,
                FOREIGN KEY (conference_id) REFERENCES core_conferences (conference_id),
                UNIQUE(conference_id, agent_id)
            )
            "#,
        )
        .execute(pool)
        .await
        .map_err(|e| format!("Failed to create participants table: {}", e))?;

        Ok(())
    }

    /// Create a new conference
    pub async fn create_conference(
        &self,
        request: CreateConferenceRequest,
    ) -> Result<Conference, String> {
        let db = self.db.read().await;
        let pool = &db.as_ref().unwrap().write_pool;

        // Create session for this conference
        let session_id = uuid::Uuid::new_v4().to_string();
        let session = session::CoreSession {
            session_id: session_id.clone(),
            user_id: request.user_id.clone(),
            active_agents: Vec::new(),
            context: HashMap::new(),
            started_at: chrono::Utc::now().to_rfc3339(),
            last_activity: chrono::Utc::now().to_rfc3339(),
        };

        // Insert session
        sqlx::query(
            r#"
            INSERT INTO core_sessions (session_id, user_id, active_agents, context, started_at, last_activity)
            VALUES (?, ?, ?, ?, ?, ?)
            "#,
        )
        .bind(&session.session_id)
        .bind(&session.user_id)
        .bind(serde_json::to_string(&session.active_agents).unwrap())
        .bind(serde_json::to_string(&session.context).unwrap())
        .bind(&session.started_at)
        .bind(&session.last_activity)
        .execute(pool)
        .await
        .map_err(|e| format!("Failed to create session: {}", e))?;

        // Create conference
        let mut conference = Conference::new(
            session_id,
            request.title,
            request.purpose,
            request.conference_type,
            request.user_id,
        );

        // Add participants if provided
        if let Some(participants) = request.participants {
            for participant_spec in participants {
                let participant =
                    ConferenceParticipant::new(participant_spec.agent_id, participant_spec.role);
                conference.add_participant(participant)?;
            }
        }

        // Insert conference
        let participants_json = serde_json::to_string(&conference.participants)
            .map_err(|e| format!("Failed to serialize participants: {}", e))?;

        sqlx::query(
            r#"
            INSERT INTO core_conferences
            (conference_id, session_id, title, purpose, conference_type, participants,
             shared_memory_id, tool_closet_id, state, created_at, started_at, concluded_at, created_by)
            VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?)
            "#,
        )
        .bind(&conference.conference_id)
        .bind(&conference.session_id)
        .bind(&conference.title)
        .bind(&conference.purpose)
        .bind(serde_json::to_string(&conference.conference_type).unwrap())
        .bind(&participants_json)
        .bind(&conference.shared_memory_id)
        .bind(&conference.tool_closet_id)
        .bind(serde_json::to_string(&conference.state).unwrap())
        .bind(&conference.created_at)
        .bind(&conference.started_at)
        .bind(&conference.concluded_at)
        .bind(&conference.created_by)
        .execute(pool)
        .await
        .map_err(|e| format!("Failed to create conference: {}", e))?;

        // Insert participants into separate table
        for participant in &conference.participants {
            let permissions_json = serde_json::to_string(&participant.permissions).unwrap();
            let tools_json = serde_json::to_string(&participant.assigned_tools).unwrap();

            sqlx::query(
                r#"
                INSERT INTO core_conference_participants
                (conference_id, agent_id, role, joined_at, permissions, individual_memory_id, assigned_tools)
                VALUES (?, ?, ?, ?, ?, ?, ?)
                "#,
            )
            .bind(&conference.conference_id)
            .bind(&participant.agent_id)
            .bind(serde_json::to_string(&participant.role).unwrap())
            .bind(&participant.joined_at)
            .bind(&permissions_json)
            .bind(&participant.individual_memory_id)
            .bind(&tools_json)
            .execute(pool)
            .await
            .map_err(|e| format!("Failed to insert participant: {}", e))?;
        }

        Ok(conference)
    }

    /// Get conference by ID
    pub async fn get_conference(&self, conference_id: &str) -> Result<Conference, String> {
        let db = self.db.read().await;
        let pool = &db.as_ref().unwrap().read_pool;

        #[derive(sqlx::FromRow)]
        struct ConferenceRow {
            conference_id: String,
            session_id: String,
            title: String,
            purpose: String,
            conference_type: String,
            participants: String,
            shared_memory_id: Option<String>,
            tool_closet_id: Option<String>,
            workflow_id: Option<String>,
            state: String,
            created_at: String,
            started_at: Option<String>,
            concluded_at: Option<String>,
            created_by: String,
        }

        let row: ConferenceRow =
            sqlx::query_as("SELECT * FROM core_conferences WHERE conference_id = ?")
                .bind(conference_id)
                .fetch_one(pool)
                .await
                .map_err(|e| format!("Conference not found: {}", e))?;

