            shared_memory_id: row.shared_memory_id,
            tool_closet_id: row.tool_closet_id,
            workflow_id: row.workflow_id,
            state: serde_json::from_str(&row.state)
                .map_err(|e| format!("Failed to parse state: {}", e))?,
            created_at: row.created_at,
            started_at: row.started_at,
            concluded_at: row.concluded_at,
            created_by: row.created_by,
        };

        Ok(conference)
    }

    /// List all conferences for a user
    pub async fn list_conferences(&self, user_id: &str) -> Result<Vec<Conference>, String> {
        let db = self.db.read().await;
